import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";
import Home from "./components/home";
import About from "./components/about";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <ul className="App-header">
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/home2">
                Home 2
              </Link>
            </li>
          </ul>
          <Routes>
            <Route
              path="/"
              element={<Home />}
            ></Route>
            <Route
              path="/home2"
              element={<Home2 />}
            ></Route>
          </Routes>
        </div>
      </Router>
    );
  }
}

export default App;
